import Tilt from 'react-parallax-tilt';
import './Logo.css'

const Logo = () => {
    return (
        <div className="ma4 mt0">
            <Tilt className="Tilt br2 shadow-2" options={{ max: 25 }} glareEnable={true} glareMaxOpacity={0.8} glareColor="#ffffff" glarePosition="bottom" glareBorderRadius="20px">
                <div style={{ height: '300px' }}>
                    <h1>Logo ðŸ‘€</h1>
                </div>
            </Tilt>
        </div>
    )
}

export default Logo;
